import React from 'react';

import {
  BrowserRouter as Router,
 // for server rendering
  Route
  // etc.
} from "react-router-dom";
import TodoList from '../../todoList/components';
class ComeBack extends React.Component {
  render() {
    console.log(this.props);
    return <div>
                {/* My Routes */}
                <Router>
                    <div>
                      <Route path="/TodoList" Component={TodoList}> </Route>
                      <Route path="/" Component={TodoList}> </Route>
                    </div>
                </Router>
              <h1  onClick={this.props.onClick}>You are so welcome ,{this.props.Messages.welcome}</h1>
              <h2> {this.props.Messages.h1} </h2>
          </div>

    ;
  }
}


export default ComeBack;
